import { NavLink } from 'react-router-dom';

const Header = () => {
  return (
    <header className="site-header">
      <NavLink to="/" className="nav-link">Home</NavLink>
      <NavLink to="/rankings" className="nav-link">Team Rankings</NavLink>
    </header>
  );
};

export default Header;
